import { createSlice, createAsyncThunk } from '@reduxjs/toolkit'
import Axios from '../Axios'



export const fetchAlllOrder = createAsyncThunk('AllOrder/fetchCart', async () => {
    const response = await Axios.get('/admin/orders').then(res => res.data)
    return response
})
export const AllOrderSlice = createSlice({
    name: 'order',
    initialState: {
        OrdersInfo: [],
    },
    reducers: {
        addToCart: (state, action) => {
        }
    },
    extraReducers: {
        [fetchAlllOrder.fulfilled]: (state, action) => {
            state.OrdersInfo = action.payload.order
        }
    }
})
export default AllOrderSlice.reducer;
